import React, {Component} from 'react';
import './AvailableServices.css';

export default class AvailableServices extends Component {



  render() {

    return (
      <div>
      <table class="table table-striped table-borderless table-hover table-card" style="table-layout: fixed">
        <thead>
          <tr class="header">
            <th style="text-align: center;">First Name</th>
            <th style="text-align: center;">Last Name</th>
            <th style="text-align: center">Subject Name</th>
            <th style="text-align: center;">Topic Name</th>
            <th style="text-align: center;">Zip Code</th>
          </tr>
        </thead>
        <tbody>
        {this.props.availableServices.map((value,index) => {
          return (<tr>
            <td>{value.firstName}</td>
            <td>{value.lastName}</td>
            <td>{value.subjectName}</td>
            <td>{value.topicName}</td>
            <td>{value.zipCode}</td>
          </tr>
        )})}
        </tbody>
        </table>
        </div>
    );
  }




}
